export default function DocketReducer (state = {}, action) {
    const { type, payload } = action;

    switch (type) {

        case 'GET_DOCKET_SUCCESS':
            return payload;
        case 'GET_DOCKET_ERROR':
            return payload;
        default:
            return state;
    }
}
